import React from 'react';
import logo from '../assets/logo.png';


export default function Header(props) {
  return (
    <header className="header">
      <h1 className="col-lg-6"><img className="img" src={logo} width="50"/>{props.ime}</h1>
      <p>{props.slogan}<img src={props.logo} width="40" /></p>
      
    </header>
  )
}
